"When the option \"Show category objects\" is chosen,       links to the objects are displayed as a list which is always sorted by type (as wiki pages or articles, blogs etc.)       with a subtitle for each type and, in a type, the links to the objects are alphabetically sorted by object title.       <br>There are two ways to display the list       <br>- the first way is named \"list by line\" where there is one link per line       (This list can be long but easier to read particularly when there are many objects)      <br>- the second way is more compact and is named \"block\" where the links are placed end to end, \"inline\" separated by the \"|\" char " => "Lorsque l'option \"Afficher les objets catégorie\" est choisie,       des liens vers les objets sont affichés dans une liste qui est toujours triée par type d'objet (pages wiki, articles, blogs, etc.)       avec un sous-titre pour chaque type et, dans un type, les liens vers les objets sont triés par ordre alphabétique suivant le titre de l'objet.       <br> Il ya deux façons d'afficher la liste       <br> - la première est appelée \"liste par ligne\" où il y a un lien par ligne       (Cette liste peut être longue, mais est plus facile à lire surtout quand il y a beaucoup d'objets)       <br> - la deuxième est plus compacte et est nommée «bloc» où les liens sont mis bout à bout, les liens sont séparés par le caractère \"|\" ",
