"Your PHP is running with safe mode enabled. This might cause problems to the import process as safe mode limits the possibility to change in run time some PHP settings (like max_execution_time). It is recommended to run this script without safe mode" => "Votre PHP s'exécute avec le mode sécurisé activé. Ceci pourrait causer des problèmes au processus d'importation car le mode sécurisé limite la possibilité de changer certains réglages d'exécution de PHP (comme max_execution_time). Il est recommandé d'exécuter ce script sans le mode sécurisé",
"Depending on the size of the file from the source software, the import process may take a while to complete. This might be a problem according to your PHP and web server settings. This script tries to change the relevant settings but there are some settings that the script cannot change. So, if you are having problems with the script, please try to increase the value of the following PHP settings: max_input_time, max_execution_time (this setting is limited by the web server setting, if you are running Apache also change its Timeout setting), post_max_size, upload_max_filesize, memory_limit. It is recommended that you run this script on a server where you can change the values of those settings (if needed)" => "Selon la taille du fichier à partir du logiciel source, le processus d'importation peut prendre un certain temps à compléter. Cela pourrait être un problème en fonction de votre PHP et les paramètres du serveur web. Ce script tente de modifier les paramètres pertinents, mais il ya certains paramètres que le script ne peut pas changer. Donc, si vous rencontrez des problèmes avec le script, s'il vous plaît essayer d'augmenter la valeur des paramètres PHP suivants: max_input_time, max_execution_time (ce paramètre est limitée par les paramètres du serveur web, si vous exécutez Apache également modifier son paramètre Délai d'attente), post_max_size , upload_max_filesize, memory_limit. Il est recommandé que vous exécutez ce script sur un serveur où vous pouvez modifier les valeurs de ces paramètres (si nécessaire)",
"WARNING: make sure to have a backup before running the script. If you do not have a backup this is the last chance to cancel the importer by clicking on the cancel button" => "ATTENTION : soyez sûr d'avoir une sauvegarde avant de lancer le script. Si vous n'avez pas de sauvegarde, c'est votre dernière chance d'annuler l'importeur en cliquant sur le bouton Annuler",
