"The \"Snarf Wikiplugin\" is activated. It can be used by wiki editors to include pages from the local network and via regex replacement create any html" => "Le plugiciel Wiki Snarf est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour inclure des pages HTML de votre réseaux local et créer des pages HTML à partir d'expressions régulières",
"The \"Regex Wikiplugin\" is activated. It can be used by wiki editors to create any html via regex replacement" => "Le plugiciel Wiki Regex est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour créer n'importe quel fichier HTML avec des remplacements par expression régulière",
"The \"Lsdir Wikiplugin\" is activated. It can be used by wiki editors to view the contents of any directory" => "Le plugiciel Wiki Lsdir est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour afficher le contenu d'un répertoire",
"The \"Bloglist Wikiplugin\" is activated. It can be used by wiki editors to disclose private blog posts" => "Le plugiciel Wiki Bloglist est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour divulguer les publications privées des blogues",
"The \"iframe Wikiplugin\" is activated. It can be used by wiki editors for cross site scripting attacks" => "Le plugiciel Wiki iframe est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour les \"cross site scripting attacks\"",
"The \"js Wikiplugin\" is activated. It can be used by wiki editors to use Javascript, which can be used to do all kind of nasty things like cross site scripting attacks, etc" => "Le plugiciel Wiki JS est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour utiliser du code javascript vous offrant plein de possibilité",
"The \"JQ Wikiplugin\" is activated. It can be used by wiki editors to use Javascript, which can be used to do all kind of nasty things like cross site scripting attacks, etc" => "Le plugiciel Wiki JQ est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour utiliser du code javascript vous offrant plein de possibilité",
"The \"Redirect Wikiplugin\" is activated. It can be used by wiki editors for cross site scripting attacks" => "Le plugiciel Wiki Redirect est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour les \"cross site scripting attacks\"",
"The \"Module Wikiplugin\" is activated. It can be used by wiki editors to add modules which permit to access information (see module list)" => "Le plugiciel Wiki Module est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour ajouter des modules permettant l'accès à des informations( voir la liste des modules)",
"The \"Userlist Wikiplugin\" is activated. It can be used by wiki editors to display the list of users" => "Le plugiciel Wiki Userlist est activé. Vous pouvez l'utiliser avec l'éditeur Wiki pour afficher la liste des utilisateurs",
